# bit-based version
from itertools import product
def b(n): # length-2n binary strings of the form ww
    if n == 0: yield 0
    for i in range(2**n):
        yield (i << n) + i
def a(n):
    st = set()
    for i in range(n):
        for w in b(i):
            s = w << (2*(n-i))
            for t in b(n-i):
                st.add(s+t)
    return len(st)
